import React from 'react';
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';

function OrderSelect({ order, handleSort }) {
  return (
    <div style={{ display: 'flex', alignItems: 'center' }}>
      <span style={{ marginRight: '10px' }}>Order</span>
      <FormControl style={{ minWidth: '150px' }}>
        <InputLabel id="order-select-label">Order</InputLabel>
        <Select
          labelId="order-select-label"
          id="order-select"
          value={order}
          onChange={handleSort}
        >
          <MenuItem value="Alphabetical">Display choices in Alphabetical</MenuItem>
          <MenuItem value="Time">Display choices in Time</MenuItem>
        </Select>
      </FormControl>
    </div>
  );
}

export default OrderSelect;
